import './App.css';
import Post from './Post.js';
import { posts } from './data.js'
import  postData  from './insta-clone-node/server.js'



function App() {
  return (
    <div className="App">
      {console.log(postData)}
     <Feed/>
    </div>
  );
}

function Feed() {
  return (
  <Post post={posts[0]}/>
  )
}


export default App;
